class Solution:
    def maxDistinctElements(self, nums: list[int], k: int) -> int:
        val_dist_list = []
        for n in nums:
            val_dist_list.extend(range(n - k, n + k + 1))
        target_dict = {t: False for t in set(val_dist_list)}
        # print(nums, k, target_dict)  # Debug print removed for production

        sorted_keys = sorted(target_dict.keys())
        for n in sorted(nums):
            for t in sorted_keys:
                if not target_dict[t] and (n - k) <= t <= (n + k):
                    target_dict[t] = True
                    break
        return sum(target_dict.values())

sol = Solution()
print(f'{sol.maxDistinctElements([1,2,2,3,3,4], 2)} expect 6')
print(f'{sol.maxDistinctElements([4,4,4,4], 1)} expect 3')
print(f'{sol.maxDistinctElements([8,7,8,7,10], 1)} expect 5')
